//Custom Hook
import { useEffect, useState } from "react"
import getGifs from "../services/getGifs"

export function useGifs({ keyword } = {keyword: null}) {
    const [gifs, setGifs] = useState([])

    useEffect(() => {
        if(keyword)
        getGifs({ keyword })
            .then(gifs => setGifs(gifs))
    }, [keyword])

    return { gifs }    

}
